                <div class="fields">
                    <div class="field">
                        <label>Quantity of tickets</label>
                        <input type="number" onChange={(e) => { qty = e.target.value }}  />
                    </div>
                    <div class="field">
                        <label>Discount percentages</label>
                        <input type="number" onChange={(e) => {percentage  = e.target.value }} />
                    </div>
                </div>

            </div>
            <button class="positive ui button">ok</button>
        </form>
    );
}

